import './Header.css'

export const Header = () => {
    return (
        <header>
            <nav>
                <h1 className="headerButton">Сервис для достижения целей</h1>
                <a className="headerButton">Лента</a>
                <a className="headerButton">Войти</a>
            </nav>
        </header>
    )
}
